import React, {Component} from "react";
import {Link} from "react-router-dom";
import HelloWorldService from "../../api/todo/HelloWorldService";

class WelcomeComponent extends Component {
    constructor(props) {
        super(props);
        this.retriveWelcomeMessage = this.retriveWelcomeMessage.bind(this);
        this.handleSuccessfulResponse = this.handleSuccessfulResponse.bind(this);
        this.state = {
            welcomeMessage: ''
        }

    }

    render() {
        return (
            <>
                <h1>Welcome !!!</h1>
                <div className="container">
                    Welcome {this.props.match.params.name}.
                    Please navigate here for Todos list <Link to="/todos"> Here </Link>
                </div>
                <div className="container">
                    click here to get the customized message.
                    <button onClick={this.retriveWelcomeMessage}
                            className="btn-btn-success">Get Welcome Message</button>
                </div>

                <div className="container">
                    {this.state.welcomeMessage}
                </div>
            </>
        )
    }

    handleSuccessfulResponse(respose) {
        this.setState({welcomeMessage: respose.data})
    }


    retriveWelcomeMessage() {
        HelloWorldService.executeHelloWorldService()
            .then( response => console.log(response))
    }
}

export default WelcomeComponent
